import React from "react";

function Aboutus(){
    return(
        
            <div id="aboutus">
                <div class="py-20 text-slate-400 bg-black">
                    <text class="py-10 text-3xl font-nunito font-semibold text-slate-100">About Us</text>
                    <p class="py-10 text-2xl font-nunito font-semibold px-28 text-justify flex-col items-center">
                        LyncFest is a National level Symposium organized by Sri Sai Ram Institute of Technology, Department of Information Technology in Association with Tagros Chemicals India Pvt. Ltd. It is where the torrent of innovative minds meets the ocean of creativity, art, and talent. Here, witness the most exciting and exhilarating challenges compiled and crafted by our students which will bring out the best of yourself.
                        <br /><br />
                    <text class="px-12">Challenge the tech geniuses in Hack in Hub. Present your ground breaking ideas in Letter Box. Crack the toughest of codes in Loop Up. Brag your IQ in La Inquizition. Explore your deductive ability in Link-a-Link. Capture the best moments in Let’s Cliq. Unleash your gamer rage at Legionz. LyncFest has everything to offer. Express and Exhibit. Don’t miss this wonderful opportunity. We are awaiting your eager participation.</text>
                    </p>
                    <p class="py-10 text-2xl font-nunito font-semibold px-28 text-justify flex-col items-center">

                    </p>
                </div>
            </div>
        )
}
export default Aboutus;
